import React from 'react';
// props
// state
// children -- Scroll can use children as a way to render its children

const Scroll = (props) => {
	return (
		<div style={{ overflowY: 'scroll', border: '5px solid black', height: '800px'}}>
		{props.children}
		</div>)
};

export default Scroll;
